import React, { Component } from "react";
import { Button, Card } from "react-bootstrap";

class Cards extends Component {
  render() {
    return (
      <div>
        <Card style={{ width: "18rem" }}>
          <Card.Img variant="top" src="holder.js/100px180" />
        </Card>
      </div>
    );
  }
}

export default Cards;
